import React from "react";
import "./Profile.css";
import coverImage from "../../img/Landscape-Color.jpg";
import profileImage from "../../img/human-3782189_640.jpg";

function Profile(props)
{
    return(
        <div className = "Profile">
            <h3 className="Logo">Design-Sphere</h3>
            <div className = "ProfileCard">
                <img className = "CoverImage" src = {coverImage} alt = "Cover"></img>
                <div className = "ProfileImage">
                    <img className = "ProfileImage" src = {profileImage} alt = "Profile"></img>
                </div>
                <div className = "Name">
                    <span><b>Name</b></span>
                    <span>@Username</span>
                </div>
                <span>Description</span>
                <button>View Full Profile</button>
            </div>
        </div>
    );
}

export default Profile;
